def is_any_device_online():
    try:
        output = subprocess.check_output(["adb", "devices"]).decode()
        for line in output.strip().splitlines()[1:]:  # B·ªè d√≤ng ƒë·∫ßu "List of devices attached"
            if "\tdevice" in line:
                return True
        return False
    except Exception as e:
        print(f"L·ªói khi ki·ªÉm tra adb devices: {e}")
        return False


