def restart_driver():
    global driver  # D√πng l·∫°i bi·∫øn global

    logging.warning("‚ö†Ô∏è UiAutomator2 c√≥ d·∫•u hi·ªáu b·ªã crash ‚Üí Ti·∫øn h√†nh reset driver...")

    # 1Ô∏è‚É£ T·∫Øt driver c≈© (n·∫øu c√≤n s·ªëng)
    try:
        driver.quit()
        logging.info("‚úÖ ƒê√£ quit driver c≈©")
    except:
        logging.warning("‚ö†Ô∏è Kh√¥ng quit ƒë∆∞·ª£c driver c≈© (c√≥ th·ªÉ ƒë√£ ch·∫øt)")

    time.sleep(2)

    # 2Ô∏è‚É£ Clear UiAutomator2 tr√™n thi·∫øt b·ªã
    logging.info("üîÅ ƒêang clear UiAutomator2 server...")
    os.system("adb shell pm clear io.appium.uiautomator2.server")
    os.system("adb shell pm clear io.appium.uiautomator2.server.test")

    # 3Ô∏è‚É£ Reset l·∫°i ADB
    os.system("adb kill-server")
    time.sleep(2)
    os.system("adb start-server")
    time.sleep(3)

    # 4Ô∏è‚É£ Kh·ªüi t·∫°o l·∫°i Appium Driver
    try:
        logging.info("üöÄ ƒêang kh·ªüi t·∫°o l·∫°i Appium Driver...")

        driver = webdriver.Remote(
            "http://localhost:4723/wd/hub",
            options=AppiumOptions().load_capabilities(desired_cap)
        )

        logging.info("‚úÖ ƒê√£ kh·ªüi ƒë·ªông l·∫°i emulator / thi·∫øt b·ªã Android th√†nh c√¥ng")

    except Exception as e:
        logging.error(f"‚ùå KH√îNG KH·ªûI T·∫†O L·∫†I ƒê∆Ø·ª¢C DRIVER: {e}")
        raise e





def get_android_device_info():
    adb_path = "adb"

    # L·∫•y danh s√°ch thi·∫øt b·ªã
    output = subprocess.check_output([adb_path, "devices"], text=True)
    devices = [line.split()[0] for line in output.strip().splitlines()[1:] if line.endswith("device")]

    if not devices:
        raise RuntimeError("‚ö† Kh√¥ng t√¨m th·∫•y thi·∫øt b·ªã n√†o k·∫øt n·ªëi.")

    udid = devices[0]

    # L·∫•y platformVersion
    platform_version = subprocess.check_output(
        [adb_path, "-s", udid, "shell", "getprop", "ro.build.version.release"],
        text=True
    ).strip()

    # L·∫•y deviceName
    device_name = subprocess.check_output(
        [adb_path, "-s", udid, "shell", "getprop", "ro.product.model"],
        text=True
    ).strip()

    return udid, platform_version, device_name


# L·∫•y th√¥ng tin thi·∫øt b·ªã
udid, platform_version, device_name = get_android_device_info()

